import React from 'react';
import '../About.css';

const About = () => {
  return (
    <section id="about" className="about">
      <h2>À propos de moi</h2>
      <p>Je me présente, Marwah, étudiante en Bachelor Concepteur Développeur d’Applications.
        Plongée dans l’univers où la technologie rencontre l’art et la cosmologie, je suis une exploratrice infatigable du savoir et de l’innovation. Passionnée par le développement informatique, je façonne des projets qui allient créativité et ingénierie, en particulier dans le domaine de la beauté et du digital. Toujours curieuse d’apprendre et de repousser mes limites, 
j’avance avec la conviction que chaque ligne de code peut dessiner un futur plus inspirant.</p>
    </section>
  );
}

export default About;
